import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import BrowserRouter, Routes, and Route
import './App.css';

import Navbar from './Components/JSX/Navbar';
import Hero from './Components/JSX/Hero';
import AboutRestaurant from './Components/JSX/AboutRestaurant';
import Special from './Components/JSX/Special';
import Cuisine from './Components/JSX/Cuisine';
import Menu from './Pages/JSX/Menu';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          {/* Define the routes for each component */}
          <Route path="/" element={<Hero />,<AboutRestaurant />,<Special />,<Cuisine />} /> {/* Home page or Hero section */}
          <Route path="/about" element={<AboutRestaurant />} /> {/* About page */}
          <Route path="/special" element={<Special />} /> {/* Special section */}
          <Route path="/cuisine" element={<Cuisine />} /> {/* Cuisine page */}
          <Route path="/menu" element={<Menu />} /> {/* Menu page */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
